import './App.css'
import NavMenu from './components/NavMenu';
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <NavMenu/>
      <Routes>
        <Route path=''/>
        <Route />
        <Route />
      </Routes>
    </div>
  );
}

export default App;
